import React from 'react';
import Container from './container';
import Navigaition from './navigation';

const NavButton = styled.button`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  border: none;
  outline: none;
`;

const AppLayout = ({children}) => {
  return (
    <Container>
      <Navigaition />
      {children}
    </Container>
  );
};

export default AppLayout;
